import React from 'react';
import { Link } from 'react-router-dom';
import './homepage.css';
import AffirmationBoxes from '../pa/pos';

const Homepage = ({ setLoginUser }) => {
  return (
    <div className="homepage">
      <h1 id="heading">Habitify today for a Better tomorrow</h1>

      <div className="logout-button" onClick={() => setLoginUser({})}>
        Logout
      </div>

      <select id="dropdown">
        <option value="" disabled selected>
          What's on your mind?
        </option>
          <option value="to-do-list"><Link to="/to-do-list">To-Do List</Link></option>
          <option value="journal"><Link to="/journal">Journal</Link></option>
          <option value="pomodoro"><Link to="/pomodoro">Pomodoro</Link></option>
          <option value="meditation"><Link to="/meditation">Meditation</Link></option>
          <option value="hydration-tracker"><Link to="/hydration-tracker">Hydration Tracker</Link></option>
          <option value="positive-affirmation"><Link to="/pos/AffirmationBoxes">Positive Affirmation</Link></option>
      </select>
    </div>
  );
};

export default Homepage;
